// import {useState} from 'react'
import MainPanel from './Main/MainPanel';
import {Route, Switch} from 'react-router-dom';
import Letter from './Main/Letter';
import Loans from './Main/Loans';
import Books from './Main/Books';
import { BookContextProvider } from './Main/BookContext'
import { LoanBookProvider } from './Main/LoanBookContext';
import ControlPanel from './AdminPane/ControlPanel';

function Main(){
    
    // const [showLoaned, setShowLoaned] = useState(true);
    
    return(
        <BookContextProvider>
            <LoanBookProvider>
            <div id ="main">
                <MainPanel />
                {/* <ControlPanel /> */}
                <Switch>
                    <Route path = '/Books'><Books /></Route>
                    <Route path = '/Loans'><Loans /></Route>
                </Switch>
                <Letter />
            </div>
            </LoanBookProvider>
        </BookContextProvider>
    )
}

export default Main;
